  array('text' => 'Приглашал к себе 24.11.18. Чертовски остался доволен. Заприметил ещё два года назад.  Тогда встретиться не сложилось. Затем исчезла из вида. И вот наконец-то всё срослось. Очень позитивная девушка. Всё как с давней знакомой.  Разговор на любую тему. В постели умелая и оргазмообильная. Люблю таких. Правда ценник немного подрос','author' => 'Genasha','name' => 'Саша'),
  array('text' => 'Был два раза. Действительно очень высокая девушка. Приняла как родного. Мило пообщались. В сексе умеет всё. Опытная и оргазмообильная. Да и вообще очень хороший человек. Не обижайте. Привет тебе','author' => 'Genasha','name' => 'Катя'),
